import React from 'react';
import {View, Text, TouchableOpacity, StyleSheet, Image} from "react-native";
import { StatusBar } from "expo-status-bar";

export default function Gerenciar_pets({navigation}){
return (
    <View style={styles.container}>
      <StatusBar hidden={true}></StatusBar>

        <Text style={styles.titulo}>Gerenciar Pets</Text>

        <View style={styles.areaBtn}>
          
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Pet')}
          >
            <Image
            source={require('../../assets/img_cadPet.png')}
            style={styles.image}
            />
            <Text style={styles.botaoText}>Cadastrar{"\n"}Pets</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Listar Pet')}
          >
            <Image
            source={require('../../assets/img_listPet.png')}
            style={styles.image}
            />
            <Text style={styles.botaoText}>Visualizar{"\n"}Pets</Text>
          </TouchableOpacity>
        </View>


        <View style={styles.tabNav}>

          <View style={{backgroundColor:'#000', height:'80%', width:'0.5%', marginLeft:10, borderRadius:10}}/>

         <View style={styles.areaBtnTab}> 
          <TouchableOpacity
            style={[styles.botaoTab, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Gerenciar Protetores')}
          >
            <Image
            source={require('../../assets/user.jpg')}
            style={styles.imageTab}
            />
            <Text style={styles.botaoTextTab}>Protetetores</Text>
          </TouchableOpacity>
        </View>

          <View style={{backgroundColor:'#000', height:'80%', width:'0.5%', borderRadius:10}}/>

         <View style={styles.areaBtnTab}> 
          <TouchableOpacity
            style={[styles.botaoTab, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Gerenciar Protetores')}
          >
            <Image
            source={require('../../assets/img_Home.png')}
            style={styles.imageTab}
            />
            <Text style={styles.botaoTextTab}>Home</Text>
          </TouchableOpacity>
        </View>

          <View style={{backgroundColor:'#000', height:'80%', width:'0.5%', borderRadius:10}}/>

        <View style={styles.areaBtnTab}>
          <TouchableOpacity
            style={[styles.botaoTab, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Gerenciar Doações')}
          >
            <Image
            source={require('../../assets/doacao.png')}
            style={styles.imageTab}
            />
            <Text style={styles.botaoTextTab}>Doações</Text>
          </TouchableOpacity>
        </View>

          <View style={{backgroundColor:'#000', height:'80%', width:'0.5%',marginRight:10, borderRadius:10}}/>

        </View>
    </View>
)
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: "space-between",

    },
    titulo:{
      backgroundColor: "#4F7063",
      fontSize: 50,
      height: '15%',
      textAlignVertical:'center',
    },
    areaBtn: {
      alignItems: "center",
      justifyContent: "center",
    },
    botao: {
      height: 127,
      padding: 15,
      borderRadius: 30,
      width:'80%',
      flexDirection: "row",
      justifyContent: 'space-between',
      alignItems: "center",
    },
    botaoText: {
      textAlign: 'left',
      fontSize: 27,
      color: "#000",
      fontWeight: "bold",
    },
    image: {
      width:90,
      height:90,
    },
    tabNav: {
      flexDirection: "row",
      justifyContent: 'space-between',
      alignItems: "center",
      backgroundColor: "#4F7063",
      height: '10%',
      width:'100%'
    },
    areaBtnTab:{
      width: '20%',
      height: '10%',
    },
    botaoTab: {
      justifyContent: 'center',
      alignItems: "center",
    },
    imageTab: {
      width:31,
      height:30,
    },
    botaoTextTab: {
      fontSize: 17,
      color: "#000",
    },
  });
